using api.Models;
using System;
using System.Collections.Generic;
using System.Data;
using System.Data.Entity;
using System.Data.Entity.Infrastructure;
using System.Linq;
using System.Net;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Web;
using System.Web.Http;
using System.Web.Http.Description;

namespace api
{
    public class getPhotoController : ApiController
    {
        private db db = new db();

        public class view
        {
            public view()
            {
            }
        }

        [HttpGet]
        public HttpResponseMessage GetPhoto(int id, string tabela)
        {
            if (tabela == "pessoa")
            {
                var foto = db.pessoa.Find(id).photo;
                if (foto != null)
                {
                    var fotoStr = System.Text.Encoding.UTF8.GetString(foto).Replace(" ", "+");
                    HttpResponseMessage response = new HttpResponseMessage(HttpStatusCode.OK);

                    response.Content = new ByteArrayContent(Convert.FromBase64String(fotoStr));
                    response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    return response;
                }
                else
                {
                    HttpResponseMessage response = new HttpResponseMessage(HttpStatusCode.OK);

                    if(db.pessoa.Find(id).perfil_id == 2)
                    {
                        response.Content = new ByteArrayContent(Convert.FromBase64String(""));
                        response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    }
                    else if (db.pessoa.Find(id).perfil_id == 3)
                    {
                        response.Content = new ByteArrayContent(Convert.FromBase64String(""));
                        response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    }
                    else if (db.pessoa.Find(id).perfil_id == 4)
                    {
                        response.Content = new ByteArrayContent(Convert.FromBase64String(""));
                        response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    }
                    else
                    {
                        response.Content = new ByteArrayContent(Convert.FromBase64String(""));
                        response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    }
                    return response;
                }
            }
            else if (tabela == "item")
            {
                var foto = db.item.Find(id).photo;
                if (foto != null)
                {
                    var fotoStr = System.Text.Encoding.UTF8.GetString(foto).Replace(" ", "+");
                    HttpResponseMessage response = new HttpResponseMessage(HttpStatusCode.OK);

                    response.Content = new ByteArrayContent(Convert.FromBase64String(fotoStr));
                    response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    return response;
                }
                else
                {
                    HttpResponseMessage response = new HttpResponseMessage(HttpStatusCode.OK);

                    if(db.item.Find(id).tipo_id == 2)
                    {
                        response.Content = new ByteArrayContent(Convert.FromBase64String(""));
                        response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    }
                    else
                    {
                        response.Content = new ByteArrayContent(Convert.FromBase64String(""));
                        response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                    }
                    
                    return response;
                }
            }
            else
            {
                return null;
            }
        }

        [HttpGet]
        public HttpResponseMessage Get(int item_id)
        {
            var foto = db.item.Find(item_id).photo;
            var fotoStr = System.Text.Encoding.UTF8.GetString(foto).Replace(" ", "+");
            if (foto != null)
            {
                HttpResponseMessage response = new HttpResponseMessage(HttpStatusCode.OK);

                response.Content = new ByteArrayContent(Convert.FromBase64String(fotoStr));
                response.Content.Headers.ContentType = new MediaTypeHeaderValue("image/jpeg");
                return response;
            }
            else
            {
                return null;
            }
        }

        protected override void Dispose(bool disposing)
        {
            if (disposing)
            {
                db.Dispose();
            }
            base.Dispose(disposing);
        }

        private bool pessoaExists(int id)
        {
            return db.pessoa.Count(e => e.id == id) > 0;
        }
    }
}